/**
 * Set the parent object for this FormatJustifyLeft object.
 * 
 * @param parentObj  A reference to the parent object of this FormatJustifyLeft object.
 */
WYMeditor.editor.prototype.desktop.toolFunctions.FormatJustifyLeft.setParent = function(parentObj) {
    this.parent = parentObj;
};

/**
 * Default event handler for 'blur' events on the FormatJustifyLeft tool.
 */
WYMeditor.editor.prototype.desktop.toolFunctions.FormatJustifyLeft.blur = function(eventObj) {
    if( (this.selfObject.parent.DEBUG != undefined) &&
        (typeof(this.selfObject.parent.DEBUG) == "boolean") &&
        this.selfObject.parent.DEBUG ) {
        console.log("The FormatJustifyLeft tool detected a 'blur' event.");
        console.log(eventObj);
    }
};

